from pathlib import Path
from typing import List, Sequence, Optional, Dict, Any
import io
import numpy as np
import chromadb
from PIL import Image
import torch
from sentence_transformers import SentenceTransformer
import base64
import os

DB_PATH = "db/"
DEVICE = "cuda" if torch.cuda.is_available() else "cpu"
CLIP = SentenceTransformer("clip-ViT-B-32", device=DEVICE)

def b64toimg(b64: str) -> Image:
    return Image.open(io.BytesIO(base64.b64decode(b64)))

def embed_images(paths: list[str]) -> np.ndarray:
    imgs = [Image.open(p).convert("RGB") for p in paths]
    vecs = CLIP.encode(
        imgs, batch_size=16,
        convert_to_numpy=True,
        normalize_embeddings=True  # สำคัญสำหรับ cosine distance
    )
    return vecs

def get_collection():
    client = chromadb.PersistentClient(path=DB_PATH)
    col = client.get_or_create_collection(
        name="furniture_images",           # ชื่อคอลเลกชัน
        metadata={"hnsw:space": "cosine"}  # (ออปชัน) ระบุ metric
    )
    return col

def create_embedding_db():
    import pandas as pd

    col = get_collection()

    # มีแล้วก็ไม่ต้องทำอะไร
    if col.count() > 0:
        print("collection already built.")
        return col

    # client = chromadb.Client()
    # col = client.get_or_create_collection(name="furniture_images")
    df = pd.read_csv("Assets/Furniture/Furniture.csv")
    BASE_DIR = Path("Assets/Furniture/Furniture Image")

    uris = [(BASE_DIR / str(p)).as_posix() for p in df["Image_file"]]

    # ตรวจไฟล์หาย
    missing = [u for u in uris if not Path(u).exists()]
    if missing:
        print("ไม่พบไฟล์:", missing[:10], f"... ทั้งหมด {len(missing)} ไฟล์")

    ids = [str(i) for i in range(1,len(df["ID"]) + 1)]

    metadatas = [
        {
            "item_name": r["Item_name"],
            "category":  r["Category"],
            "url":       r["URL"]
        }
        for _, r in df.iterrows()
    ]
    embs = embed_images(uris)

    col.add(
        ids=ids,
        embeddings=embs.tolist(),
        metadatas=metadatas,
        uris=uris,
    )

    return col
# .update({'distances': res["distances"]})
def img2search(path,label):
    if os.listdir(DB_PATH):
       col = get_collection()
    else:
       col = create_embedding_db()
    img = b64toimg(path)
    vec = CLIP.encode(img, batch_size=16,convert_to_numpy=True,normalize_embeddings=True)
    res = col.query(query_embeddings=[vec.tolist()],n_results=1,where={"category": label},include=["uris","metadatas","distances"])

    all_metas = [{**d, 'uris': dist} for metas_row, dists_row in zip(res['metadatas'], res['uris'])for d, dist in zip(metas_row, dists_row) ]
    return all_metas
    
if __name__ == '__main__':
    img2search("",'plant')